var title_f24_11_24764="Giftedness characteristics";
var content_f24_11_24764=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F83641&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F83641&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Presentation and characteristics of giftedness",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Characteristics of giftedness",
"       </td>",
"       <td class=\"subtitle1\">",
"        Example",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early language development",
"       </td>",
"       <td>",
"        A 2-year-old who speaks in complex sentences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early reading and writing skills",
"       </td>",
"       <td>",
"        A preschooler who reads text with comprehension or writes in sentences with minimal or no instruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Complaints of boredom at school, in the presence of clear academic success",
"       </td>",
"       <td>",
"        \"Why do I have to do the same thing over and over again?\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unusual academic skills in math",
"       </td>",
"       <td>",
"        Self-acquired ability and interest in numbers (eg, learning to multiply numbers mentally before formal schooling)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intense interests",
"       </td>",
"       <td>",
"        A strong preoccupation with an area of interest, academic or nonacademic (eg, airplanes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Clearly advanced skills in academic or non-academic areas, especially when identified by a teacher or a professional in an academic or non-academic domain",
"       </td>",
"       <td>",
"        Highly advanced drawing skills, athletic abilities, musical ability, etc",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Characteristics NOT indicative of school-house giftedness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Advanced motor skills, especially before 2 years of age*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        High scores on a developmental assessment tool, especially when administered before 3 years of age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Advanced rote learning skills, such as letter identification, number identification, or reading decoding without text comprehension",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Advanced motor skills may be associated with giftedness in athletics or other kinesthetic domains.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <ol>",
"      <li>",
"       Robinson NM, Olszewski-Kubilius PM. Gifted and talented children: issues for pediatricians. Pediatr Rev 1996; 17:427.",
"      </li>",
"      <li>",
"       Ruf DL. 5 Levels of Gifted: School Issues and Educational Options, Great Potential Press, Scottsdale, AZ 2009.",
"      </li>",
"      <li>",
"       Webb TJ, Amend ER, Webb NE, et al. Misdiagnosis and Dual Diagnosis of Gifted Children and Adults: ADHD, Bipolar, OCD, Asperger&rsquo;s, Depression, and Other Disorders, Great Potential Press, Scottsdale, AZ 2005.",
"      </li>",
"      <li>",
"       Winner E. Gifted Children: Myths and Realities, Basic Books, New York 1996.",
"      </li>",
"      <li>",
"       Winner E. Exceptionally high intelligence and schooling. American Psychologist 1997; 52:1070.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
